import React from 'react';

const pic1 = require("../picture/bussiness.jpg");
const pic2 = require("../picture/casual.jpg");
const pic3 = require("../picture/shirt.jpg");
const pic4 = require("../picture/vest.jpg");
const pic5 = require("../picture/shoes.jpg");

class MainCategory extends React.Component{

    render(){
        return(
            <div className="main-category">
                <div className="item1">
                    <img className="item1-img" src={pic1}/>
                </div>
                <div className="item2">
                    <img className="item2-img" src={pic2}/>
                </div>
                <div className="item3">
                    <img className="item3-img" src={pic3}/>
                </div>
                <div className="item4">
                    <img className="item4-img" src={pic4}/>
                </div>
                <div className="item5">
                    <img className="item5-img" src={pic5}/>
                </div>
                <div className="item6">
                    <div>
                        <h5>A CASUAL</h5><br/>
                        <p>
                            AFFAIR.
                            Our new season jackets are designed to help you look smart and sharp. Pair with merino wool knitwear and a pair of neutral chinos, for days when things are a little slower.

                            The Casual Offer.
                            20% off when you buy 1 jacket, 1 pair of chinos & 2 shirts.
                            Exclusions apply.
                        </p>
                    </div>
                </div>
            </div>
        );
    }
}

export default MainCategory;
